import Slideshow from './Slideshow/Slideshow';
import AboutMeShort from './AboutMeShort/AboutMeShort';
import ShortGallery from './ShortGallery/ShortGallery';

export default function Home() {

  return (
    <div style={{marginBottom: 100}}>
      <Slideshow />
      <div
        style={{
          margin: 'auto',
          padding: '40px 50px',
          maxWidth: '1300px',
          minWidth: '300px'
      }}>
        <AboutMeShort />
        <ShortGallery />
      </div>
    </div>

  )
}
